import React from 'react';
import {IonContent, IonFab, IonFabButton, IonHeader, IonIcon, IonPage, IonTitle, IonToolbar} from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Suitcases.css';
import {add} from "ionicons/icons";

const Suitcases: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Your Suitcases</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonItemGroup>
          <IonItemDivider>
            <IonLabel>A</IonLabel>
          </IonItemDivider>

          <IonItem>
            <IonLabel>Angola</IonLabel>
          </IonItem>
          <IonItem>
            <IonLabel>Argentina</IonLabel>
          </IonItem>
          <IonItem>
            <IonLabel>Armenia</IonLabel>
          </IonItem>
        </IonItemGroup>
        <IonFab vertical="bottom" horizontal="end" slot="fixed">
          <IonFabButton href="/addtrip">
            <IonIcon icon={add} />
          </IonFabButton>
        </IonFab>

      </IonContent>
    </IonPage>
  );
};

export default Suitcases;
